import React, { Component } from "react";
import Header from "../../component/header";
import { withRouter } from "react-router";
import MaterialTable from "material-table";
const data = [
  {
    id: 1,
    name: "Gram"
  },
  {
    id: 2,
    name: "Pieces"
  },
  {
    id: 3,
    name: "Kilogram"
  },
  {
    id: 4,
    name: "Liter"
  },
  {
    id: 5,
    name: "Kilobyte"
  },
  {
    id: 6,
    name: "Kilobyte"
  },
  {
    id: 7,
    name: "Kilobyte"
  }
];

class UnitPageList extends Component {
  constructor(props) {
    super(props);
  }
  onRowClick = (event, data) => {
    console.log(this.props.history);
    this.props.history.push("/units/${data.id}");
  };
  render() {
    return (
      <div>
        <Header>
          <MaterialTable
            columns={[
              { title: "id", field: "id" },
              { title: "name", field: "name" }
            ]}
            data={data}
            title="Unit"
            onRowClick={this.onRowClick}
          />
        </Header>
      </div>
    );
  }
}

export default withRouter(UnitPageList);
